<html lang="en">
  <head>
    <style>
      body {
        padding: 0;
        margin: 0;
        background: #fff;
        max-width: 100vw;
        overflow: hidden;
      }

      body * {
        box-sizing: border-box;
      }

      .email-table {
        background-color: #fff;
        margin: 0 auto;
        text-align: center;
      }

      .body-row {
        background-color: #eeeeee;
      }

      .image-otp-container {
        position: relative;
        padding-top: 0.5rem;
        background: #ffffff;
      }

      .otp-field {
        position: absolute;
        top: 479px;
        width: 390px;
      }

      .otp-field > div {
        width: 290px;
        background: white;
        margin: auto;
        border-radius: 5px;
        padding: 8px 5px 11px;
        height: 60px;
        display: flex;
        justify-content: center;
        align-items: center;
        column-gap: 10px;
      }

      .otp-field > div > input {
        width: 30px;
        text-align: center;
        border-radius: 0;
        border: none;
        caret-color: #9baeec;
        color: #1e1e1e;
        transform: scale(2.1);
      }

      .disabled {
        opacity: 0.5;
      }

      .otp-field > div > input::placeholder {
        position: relative;
        top: 3.5px;
      }

      .otp-field > div > input:focus {
        outline: none;
        /* border: none; */
      }
    </style>
